export default function Eduction(props){
    let education=props.content;
    return(
        <>
            {
                education.map((el)=>(
                    <div>
                        <img src={el.image} className="w-1/3"></img>
                        <p>{el.institute}</p>
                        <p>{el.degree}</p>
                        <p>{el.duration}</p>
                    </div>
                ))
            }
        </>
    )
}
